INSERT INTO `question_paper` VALUES (1,'A','Template Class','Abstract class','Efficient Code','Final Class','Which of the following class is known as the generic class?.','MCQ',164),(2,'B','\r\nmisfortunes','changes','suprises','sorrows','In each of the sentences given below a word is printed in bold. Below it four choices are given. Pick up the one which is most nearly the same in meaning as the word printer in bold/italic and can replaces it without altering the meaning of the sentence.\r\nThe great artist life was full of  \"vicissitudes\".','MCQ',164),(3,'A','holding the animals in captivity for our joy','going out of the house on a holiday','setting the animals free into forest','feeding the animals while others are watching','In each question, an incomplete statement (Stem) followed by fillers is given. Pick out the best one which can complete incomplete stem correctly and meaningfully.\r\nShe never visits any zoo because she is strong opponent of the idea of ........','MCQ',164),(4,'C','Member functions can be used for modifying the data type of data members','The modification of the code can be additional overhead','The data type of the data member can be easily modified without modifying any other code','The data type of data member cannot be modified.','Which among the following concept is correct if a user using the concept of encapsulation in a code?','MCQ',164),(5,'D','\r\nhotly debated','\r\nstuck up','ignored','\r\ngoing on slowly','Some proverbs/idioms are given below together with their meanings. Choose the correct meaning of proverb/idiom, If there is no correct meaning given, E (i.e.) \'None of these\' will be the answer.\r\nThis matter has been hanging fire for the last many months and must therefore be decided one way or the other.','MCQ',164),(6,'D','animal','zoo','prisoner','encloser','Each question has an underlined word followed by four answer choices. You will choose the word that is a necessary part of the underlined word.\r\n\"Cage\"','MCQ',164),(7,'D','Only assumption I is implicit','Both I and II are implicit','\r\nEither I or II is implicit','Only assumption II is implicit','In each question below is given a statement followed by two assumptions numbered I and II. You have to consider the statement and the following assumptions and decide which of the assumptions is implicit in the statement.\r\n\r\nGive answer\r\n\r\n(A) If only assumption I is implicit\r\n(B) If only assumption II is implicit\r\n(C) If either I or II is implicit\r\n(D) If neither I nor II is implicit\r\n(E) If both I and II are implicit.\r\n\r\n\r\nStatement: \"Please put more people on the job to make up for the delay.\"\r\n\r\nAssumptions:\r\n\r\nI. Delay is inevitable in most jobs.\r\nII. Output will increase with more number of people on the job.','MCQ',164),(8,'C','33 37','36 40','34 38','34 36 ','Look carefully for the pattern, and then choose which pair of numbers comes next.\r\n6 10 14 18 22 26 30','MCQ',164),(9,'B','G','J','I','H','Each of these questions are based on the information given below :\r\n8 persons E, F, G, H, I, J, K and L are seated around a square table - two on each side.\r\nThere are 3 ladies who are not seated next to each other.\r\nJ is between L and F.\r\nG is between I and F.\r\nH, a lady member is second to the left of J.\r\nF, a male member is seated opposite to E, a lady member.\r\nThere is a lady member between F and I.\r\nWho among the following is to the immediate left of F ?','MCQ',164),(10,'B','375','400','600','800','A alone can do a piece of work in 6 days and B alone in 8 days. A and B undertook to do it for Rs. 3200. With the help of C, they completed the work in 3 days. How much is to be paid to C?','MCQ',164),(11,'A','Private access specifier','Public access specifier','Protected access specifier','Depend on compiler','The name of the default access specifier for the member functions or data members in the C++ programming language is_________.','MCQ',164),(12,'C','564','645','756','75