oming close and big.','A catastrophe was imminent.','Jack was yelling.','There was a shower of debris.','Which one of the following reasons would one consider as more as possible for the warning lights to be on?','MCQ',98),(34,'B','round','on','with','over','Pick out the most effective word(s) from the given words to fill in the blank to make the sentence meaningfully complete.\r\n\r\nFate smiles ...... those who untiringly grapple with stark realities of life.','MCQ',98),(35,'A','\r\n200','10','10240','none','Find out the wrong number in the series.\r\n40960, 10240, 2560, 640, 200, 40, 10','MCQ',98),(36,'C','\r\nRs. 9600','\r\nRs. 6500','\r\nRs. 6240','\r\nRs. 3100','\r\nIn order to obtain an income of Rs. 650 from 10% stock at Rs. 96, one must make an investment of:','MCQ',98),(37,'B','200m','173m','156m','170m','From a point P on a level ground, the angle of elevation of the top tower is 30Â°. If the tower is 100 m high, the distance of point P from the foot of the tower is:','MCQ',98),(38,'D','9','1','49','20','Find the odd man out.\r\n1, 4, 9, 16, 20, 36, 49','MCQ',98),(39,'A','60/11 days','71/11 days','61/11 days','72/11 days','\r\nP can complete a work in 12 days working 8 hours a day. Q can complete the same work in 8 days working 10 hours a day. If both P and Q work together, working 8 hours a day, in how many days can they complete the work?','MCQ',98),(40,'C','16','18','24','20','The sum of how many terms of the series 6 + 12 + 18 + 24 + ... is 1800 ?','MCQ',98),(41,'B','South-East','West','North','East','Rahul put his timepiece on the table in such a way that at 6 P.M. hour hand points to North. In which direction the minute hand will point at 9.15 P.M. ?','MCQ',98),(42,'D','\r\nThere are three persons to the right of Paul.','\r\nRobert is not at the left end.','\r\nRobert is in between Simon and Taud.','Taud is in between Paul and Jack.','There are 8 houses in a line and in each house only one boy lives with the conditions as given below:\r\n\r\nJack is